Alabama

Travel Documentary hosted by Russ Harris, published by Smithsonian Channel broadcasted as part of Smithsonian Channel - Aerial America series in 2012 - English narration


Information
------------------------------

Buckle up and &quot;Roll Tide&quot; as we take an aerial journey over vast cotton fields, endless waters, storied football stadiums, and historical landmarks that collectively tell the tale of Sweet Home Alabama. Discover its rich history as we reveal the astronomical discoveries that helped us reach the moon and the civil rights victories that forged a path to equality for millions. The story of the Cotton State has as many dramatic turns as the tracks of the Talladega Superspeedway, and you have an unobstructed, breathtaking bird's eye view.

